import React, { useState } from "react";
import NetflixModal from "./NetflixModal"

function MyCliques() {

  return(
    <div>
      <div>
        <button onClick={() => showModal(true)}>
          Create New Clique</button>
        <NetflixModal
          isOpen={showModal}
          onClose={() => showModal(false)}
        />
      </div>
    </div>
  )
}

export default MyCliques;
